import React from 'react';

const DisplayBrewInfo = ({brew}) => {
    return (
        <div>
            <h3>Name: {brew.name}</h3>
            <p>Brewery_type: {brew.brewery_type}</p>
            <p>Adress: {brew.street} </p>
            <p>{brew.city}, {brew.state} {brew.postal_code}</p>
        </div>      
    )
}

export default DisplayBrewInfo;
